Oficialiai pirmadienį vėl „Bayern“ šeimos nariu tapęs J. Heynckesas buvo nepaprastai motyvuotas, o savo sugrįžimą apibūdino kaip draugystės gestą. „Esu čia kūnu ir siela. Ir labai džiaugiuosi, kad vėl galiu vadintis „Bayern“ dalimi. Čia nėra kalba apie mane, o apie komandą. Dabar paprasčiausiai laimėsime laiko. O tuomet pristatinėsite adekvatų trenerį. Yra daug gerų jaunų vokiečių trenerių“, – per spaudos konferenciją kalbėjo iki sezono pabaigos komandai vadovausiantis specialistas. Tuomet jis rėžė, kad tikrai nesvajojo dar kartą sugrįžti kaip treneris: „Tam turėjau galimybių ir anksčiau. Visiškai atsitraukiau nuo futbolo, turėjau netgi pasiūlymų tapti ekspertu žiniasklaidoje. Kas mane pažįsta, žino, kad viešumo tikrai neieškau. Turėjau nepaprastai patogų gyvenimą, tačiau buvo priežasčių, dėl kurių sutikau imtis šio darbo. Svarbiausia jų – draugystė“. Pirmadienį pirmą treniruotę po sugrįžimo komandai pravedęs J. Heynckesas tvirtino, kad turi visiškai aiškų planą, ką daryti. „Pirmiausiai reikia nuraminti žaidėjus, motyvuoti juos, suformuoti komandą, kuri kartu gali viską, – kalbėjo jis. – „Bayern“ parodys kitą veidą. Esu įsitikinęs, kad man pavyks“. Artimiausi trenerio iššūkiai – spalio 14-ą dieną Bundeslygos rungtynės su „SC Freiburg“ ir spalio 18-ą dieną UEFA Čempionų lygos dvikova su Glazgo „Celtic“. J. Heynckesas sulaukė ir klausimų apie savo garbų amžių. „Mano pulsas ramybės būsenoje yra 60, o kraujo spaudimas – nuo 120 iki 70. Fiziškai esu geros formos. Vieni būdami 45-erių jau būna seni, o kiti ir 70-ies dar jauni. Prie pastarųjų esu ir aš“, – šypsojosi strategas. „Bayern“ senbuvis  Thomas Mulleris  džiaugėsi J. Heynckeso sugrįžimu: „Jis gali duoti komandai naują impulsą, aistrą, pasirengimą. Turėsime „stiprių“ treniruočių, nes Juppas darbą atlieka su dideliu intensyvumu ir pasišventimu. Mes turime keletą vietų, kurias reikia sutvarkyti“. J. Heynckesas „Bayern“ treniravo 1989 ir 1990 metais, 2009 metais sugrįžo į komandą po Jurgeno Klinsmanno atleidimo, o 2011 metais vėl buvo įdarbintas, kai komanda atsisveikino anksčiau laiko su Louisu van Gaalu. Paskutinį kartą J. Heynckesas prie „Bayern“ komandos vairo stovėjo 2013 metais. Tuomet bavarai šventė visuose trijuose frontuose – laimėjo šalies čempionatą, taurę ir UEFA Čempionų lygą. Kai po šio triumfo „Bayern“ pasirašė ketverių metų sutartį su Pepu Guardiola, J. Heynckesas nusprendė „išeiti į pensiją“. (function(d, s, i, r) {
